import './Header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceMehBlank } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from 'react-router-dom';

function Header() {
  const navigate = useNavigate();
  const handleProjectClick = (projectId) => {
    // Navigate to the next page with the project ID as a query parameter
    navigate(`/project?projectId=${projectId}`);
  };
  return (
    <>
      <div className='spacer'></div>
      <header className='header'>
        <div className='header-logo'>
          <h2>Project Vault</h2>
        </div>
        <div className='header-nav-elements'>
          <a href="#">
            <div>Home</div>
          </a>
          <a href="#">
            <div>About</div>
          </a>
          <a href="#">
            <div>Contact</div>
          </a>
          <a href="#">
            <div>
              <FontAwesomeIcon icon={faFaceMehBlank} className='icon' />
            </div>
          </a>
        </div>
      </header>
    </>
    
  );
}

export default Header;
